function Router() {



  return (
    <React.StrictMode>
      <BrowserRouter>
        <Route exact path="/" component={Auth} />
        <Route exact path="/movies" component={App} />
      </BrowserRouter>
    </React.StrictMode>
  );
}

ReactDOM.render(
